import React, { useEffect, useState } from "react";

const Footer = ({ how_to_use }) => {
  const [data, setData] = useState([]);

  console.log(how_to_use);

  useEffect(() => {
    async function fetchData() {
      const response = await fetch("/translate/PT_BR.json");
      const json = await response.json();
      setData(json);
    }
    fetchData();
  }, []);

  console.log(data);

  return (
    <div className='flex p-10 pb-6  '>
      <p className='font-extrabold opacity-50 ml-10 '>
        Como utilizar:
        <br />
        <br />
        Insira a quantidade de dooplons que você tem disponivel
        <br />
        e o preço de cada tipo de pergaminho em seu servidor
        <br />
        depois clique em calcular!
      </p>
    </div>
  );
};

export default Footer;
